ivacy policy will open, user handles it\r\n\r\n  @ChangeGridAndValidatePriceOverride\r\n  Scenario: Test scenario for verifying price override icon after chanigng gird\r\n    Given User must be on Order Entry Page\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and select any OG from popup\r\n      |SampleOG|\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Enter Pro# in Quick Product Entry area\r\n    And Check for Case and Unit input box enabled or not based on that enter value\r\n      |1|1|\r\n    And User clicks on Grid type drop down and select different grid\r\n     # |Regression grid|\r\n    Then User verifies visibility of Price override icon and reset Grid type to Main grid\r\n      #|Main grid|\r\n    And User navigates back to OE by selecting Discard all option from pending order popup\r\n\r\n  @OrderHistoryChangeGridType\r\n  Scenario: Test scenario for changing grid type in order history\r\n    Given User must be on Order Entry Page\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then User should click on Copy from dropdown and Select Order history\r\n      |Order history|\r\n    Then User verifies Order history page and change grid types\r\n    Then User changes grid to verify and reset Grid type to Main grid in order history page\r\n    And User should navigate back to Order entry page from Order history page\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/OrderEntryFeature/orderEntryFeature7.feature","feature":{"location":{"line":1,"column":1},"lan login to application and selecting Account#\r\n    Given User enters URL and is on login page and entered credentials\r\n    When User is on Home Page\r\n    Then User navigate to Client side\r\n    Then User should select Order Entry tab\r\n    Then User selects Account#\r\n\r\n@FilteringInCatalogByBrand\r\nScenario: Test scenario for filtering Brand in catalog popup\r\n  Given User must be on Order Entry Page\r\n  Then User must click Start Order button\r\n  Then User should make selection between Pending order or Start New order\r\n  Then User should select Note from popup and Order guide from popup\r\n  Then Enter PO# for New order\r\n    |PO123|\r\n  Then Click on Add product drop down and select catalog option\r\n  And User searches for Brand and goes through the product numbers\r\n  Then Click on Back button\r\n  And Discard all Pending order should be displayed\r\n  Then User should be navigated to Order Entry page\r\n\r\n@FilteringInCatalogByQoH\r\nScenario: Test scenario for filtering Qty on Hand in catalog popup\r\n  Given User must be on Order Entry Page\r\n  Then User must click Start Order button\r\n  Then User should make selection between Pending order or Start New order\r\n  Then User should select Note from popup and Order guide from popup\r\n  Then Enter PO# for New order\r\n    |PO123|\r\n  Then Click on Add product drop down and select catalog option\r\n  And User searches for QoH and goes through the product numbers\r\n    |0|\r\n  Then Click on Back button\r\n  And Discard all Pending order should be displayed\r\n  Then User should be navigated to Order Entry page\r\n\r\n@LastdatePickupOrder\r\nScenario: Test scenario for creating order for the Last date in Pickup order dialogbox\r\n  Given User must be on Order Entry Page\r\n  When User clicks on drop down next to Start order button\r\n  And Select Pickup Order from drop down options and select last delivery date\r\n  Then User should select Note from popup and Order guide from popup\r\n  Then Enter PO# for New order for Pickup order\r\n    |PO123|\r\n  Then Enter Pro# in Quick Product Entry area\r\n  And Check for Case and Unit input box enabled or not based on that enter value\r\n    |1|1|\r\n  Then Click on Next button\r\n  And Click on SubmitOrder button\r\n  Then User should be navigated to Order Entry page and compare the dates\r\n\r\n@SearchProductCatalogIndexDialogbox\r\nScenario: Test scenario for searching for product in catalog index dialog box\r\n  Given User must be on Order Entry Page\r\n  Then User must click Start Order button\r\n  Then User should make selection between Pending order or Start New order\r\n  Then User should select Note from popup and Order guide from popup\r\n  Then Enter PO# for New order\r\n    |PO123|\r\n  Then Click on Add product drop down and select catalog option\r\n  And User should select Product from catalog Index popup search input box and Enter Qty for the products\r\n    |1|1|\r\n  Then Click on Next button\r\n  And Click on SubmitOrder button\r\n  Then User should be navigated to Order Entry page\r\n\r\n@PaymentOptionsDisabled\r\nScenario: Test scenario to verify that payment page all payment options are disabled once order is submitted and reopen the order\r\n    Given User must be on Order Entry Page\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Enter Pro# in Quick Product Entry area\r\n    And Check for Case and Unit input box enabled or not based on that enter value\r\n      |1|1|\r\n    Then Click on Next button and select the very first payment option\r\n    And Click on Submit Order button and read Order_no\r\n    Then User should be navigated to Order Entry page\r\n    Then Enter Order# in Search box in Order Entry page\r\n    And User should verify that payment options in Payment page are disabled\r\n    And Click on SubmitOrder button\r\n    Then User should be navigated to Order Entry page\r\n\r\n@CheckPaymentInfoInSummaryPage\r\nScenario: Test scenario to verify payment info in summary page\r\n  Given User must be on Order Entry Page\r\n  Then User must click Start Order button\r\n  Then User should make selection between Pending order or Start New order\r\n  Then User should select Note from popup and Order guide from popup\r\n  Then Enter PO# for New order\r\n    |PO123|\r\n  Then Enter Pro# in Quick Product Entry area\r\n  And Check for Case and Unit input box enabled or not based on that enter value\r\n    |1|1|\r\n  Then Click on Next button and read payment methods\r\n  And Click on SubmitOrder button and compare payment info\r\n  Then User should be navigated to Order Entry page\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/OrderEntryFeature/orderEntryFeature8.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Order Entry8","description":"  Used for cration of New order in different ways\n  Used for canceling order, editing of order, skipping of order","children":[{"background":{"location":{"line":5,"column":3},"keyword":"Background","name":"For login to application and selecting Account#","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","text":"User enters URL and is on login page and entered credentials","id":"58f0aba4-8d6c-4f7d-bc8e-29db188ed4dc"},{"location":{"line":7,"column":5},"keyword":"When ","text":"User is on Home Page","id":"cf96bd01-5c6d-41d2-8f78-4e855214083b"},{"location":{"line":8,"column":5},"keyword":"Then ","text":"User navigate to Client side","id":"a5e89d8c-a432-405f-9e61-d42e944a9f47"},{"location":{"line":9,"column":5},"keyword":"Then ","text":"User should select Order Entry tab","id":"cc26287d-30a en Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Click on Cancel button\r\n    And Cancel popup should appear and verify button Cancel and Skip button\r\n    Then User should be navigated to Order Entry page\r\n    And User should reset the delivery date to current date\r\n\r\n  @SkipOrder\r\n  Scenario: Skip order, which will not let user to create New order for selected date\r\n    #Given User must be on Order Entry Page to Skip Order\r\n    Given User must be on Order Entry Page\r\n    Then Change the date 5 days after current date\r\n    Then Check for Skip button is visible and Click on Skip button and select reason\r\n      |Closed|\r\n    And Check for visibility of Remove Skip button\r\n    And User should reset the delivery date to current date\r\n\r\n  @RemoveSkipOrder\r\n  Scenario:Remove Skip order button, that appears in OE page\r\n    #Given User must be on Order Entry Page to Skip Order\r\n    Given User must be on Order Entry Page\r\n    Then Change the date 5 days after current date\r\n    Then Check for Remove Skip button is visible and Click on Remove Skip button\r\n    And User should reset the delivery date to current date\r\n\r\n  @SkipFromNewOrderEntry\r\n  Scenario: Skip the creation of order from new order entry page\r\n    #Given User must be on Order Entry Page to Skip Order\r\n    Given User must be on Order Entry Page\r\n    Then Change the date 5 days after current date\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Click on Skip button in New order entry page and also select the reason\r\n      |closed|\r\n    Then User should be navigated to Order Entry page\r\n    Then Check for Remove Skip button is visible and Click on Remove Skip button\r\n    And User should reset the delivery date to current date\r\n\r\n  @CancelAndSkipDisabled\r\n  Scenario: Test scenario for verifying Cancel and Skip button is disabled in new OE\r\n    Given User must be on Order Entry Page\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Click on Cancel button\r\n    And Cancel popup should appear and verify button Cancel and Skip button for current date\r\n    Then User should be navigated to Order Entry page\r\n    And User should reset the delivery date to current date\r\n\r\n  @ChangeGridAndChangePriceOverride\r\n  Scenario: Test scenario for verifying price override by changing the price after chanigng gird\r\n    Given User must be on Order Entry Page\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and select any OG from popup\r\n      |SampleOG|\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Enter Pro# in Quick Product Entry area\r\n    And Check for Case and Unit input box enabled or not based on that enter value\r\n      |1|1|\r\n    And User clicks on Grid type drop down and select different grid\r\n    Then User verifies visibility of Price override icon change the Price in price override and reset Grid type to Main grid\r\n      |0.01|\r\n    And User navigates back to OE by selecting Discard all option from pending order popup\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/OrderEntryFeature/orderEntryFeatureEnd.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Order entry End","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"For
